Human design, психология, таро и другая эзотерика. Специалисты и клиенты. Всё под одной крышей.

Клиент:

– Создавайте заявки на консультации. Указывайте в заявке время и удобное место встречи (бар, кафе, любое удобное Вам место). В разных заявках указывайте разные места (завтра в центре, послезавтра ближе к дому). Ждите отклика специалиста;
– Просматривайте список специалистов. Примените фильтр по специализации, городу или рейтингу. Выберите специалиста в удобной локации прямо на карте. Обсудите детали встречи в чате;
– Хотите online консультацию? Укажите это в заявке или фильтре.

Специалист:

– Выберите специализацию;
– Расскажите о себе, своей деятельности;
– Укажите место проведения консультации (любое удобное для Вас: бар, кафе, парк или Ваш личный кабинет) и/или укажите, что проводите консультации online;
– Загрузите дипломы и сертификаты при наличии;
– Просматривайте заявки клиентов и выбирайте удобные. Клиент может указать любое комфортное для себя место проведения консультации. Вам решать, удобно ли там встретиться;

– Находите друг друга, знакомьтесь, общайтесь и уточняйте детали встречи в чате.

Реальная эзотерика и психология в одном приложении.

